import React from 'react';
import { Link } from 'react-router-dom';
import './inicio.css'

export function Inicio() {
    return (
      <div className='IniCointainter'>
          <div className='textIni'>
              <h1>Dogs</h1>
          </div>
        
          <Link to= '/home'>
              <button className='btnIni'>Join</button>
          </Link>  
      </div>
    )
  };
